import React from "react";
export default function Dashboard(){
    const logout = () => {
        //alert("Loggin out ... ");
        sessionStorage.removeItem('userID');
        window.location.href = '/login';
    }
    const handlePanels = (myText) =>{
        alert(myText);
    }
    return(
        <div className="d-flex flex-mobile" style={{minHeight:'60vh'}}>
            <div className="side-panel">
                <PanelButton btnName="Chats"/>
                <PanelButton btnName="Chats"/>
            </div>
            <div className="main-panel">
                <span>
                    <LogoutButton/>
                </span>
            </div>
        </div>
    );
    
    function LogoutButton(){
        return(
            <button onClick={logout} className="btn btn-danger">Logout</button>
        );
    }
    function PanelButton({ btnName }) {
        return (
          <button onClick={handlePanels} className="btn btn-primary w-80">{btnName}</button>
        );
    }
}
